def get_nnGrid(n: int):
    my_coupling = []
    for i in range(n):
        for j in range(n):
            if j < n-1:
                my_coupling.append((i*n +j,i*n +j+1))
            if i < n-1:
                my_coupling.append((i*n +j,i*n +j+n))
    device = createDevice(name="grid", nqubits=n*n, connection=my_coupling)
    # device.printDevice()
    return my_coupling, device

